import { render } from 'react-dom';

function Post({ id }){

    const handleClick = (e) => {
        e.preventDefault()
        router.push('/blog/')
    }

    

    const router = useRouter();
    var { id } = router.query
    var y = router.query
    y = JSON.stringify(y)
    let x = JSON.stringify({id});
    var key = Object.keys({id});
    console.log("KEYS: ", Object.keys({id}));
    console.log("VALUES: ", Object.values(y));
    console.log("ENTRIES: ", Object.entries(x));

    let values = Object.values(x);
    console.log("TEST: ", values)

    console.log("ROUTE: ", key);

    //API URL
  //  const api_url = `https://jsonplaceholder.typicode.com/posts/${key}`

    return (
        <>
            <Head>
                <title>Blog Post: { id } </title>
                <meta name="viewport" content="initial-scale=1.0, width=device-width"/>
            </Head>
            <button onClick={handleClick}>Go Back</button>
            <div>Blog Post { id } Details:</div>

        <div>
                <div>
                    Title: { id }
                    <div>
                        By:
                    </div>
                </div>
            <div>
                Body:
            </div>

        </div>

        <button onClick={handleClick}>AuthorDetails</button>
        </>
        )
    };

    export async function getStaticPaths() {
        const res = await fetch(`https://jsonplaceholder.typicode.com/posts`)
        const postData = await res.json()

        let paths = postData.results.map(p => {
            return `/posts/${p.id}`
        })
    
        return {
            paths,
            fallback: false
        }
    }

    export async function getStaticProps({ params }) {
        const res = await fetch(`https://jsonplaceholder.typicode.com/posts/${params.postData}`)
        const postData = await res.json()
        
        console.log(postData);

        return {
            props: {
             postData
            }
        }
    }
   
    
